import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import { Plus, ShoppingBag, Filter } from 'lucide-react';

const CategoryPage = ({ addToCart }) => {
  const { categoryName } = useParams(); // Gets 'Smartphones', 'Laptops', etc. from URL
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchCategoryProducts = async () => {
      setLoading(true);
      const { data } = await supabase
        .from('products')
        .select('*')
        .eq('category', categoryName); // Filter by the URL name
      
      setProducts(data || []);
      setLoading(false);
    };
    fetchCategoryProducts();
  }, [categoryName]);

  return (
    <div style={{ padding: '40px 60px', backgroundColor: '#f4f7f8', minHeight: '100vh' }}>
      {/* Breadcrumbs & Header */}
      <div style={{ marginBottom: '30px' }}>
        <p style={{ color: '#888', fontSize: '14px' }}>MegaMart > {categoryName}</p>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <h1 style={{ fontSize: '32px', margin: 0 }}>{categoryName}</h1>
          <button style={filterBtn}>
            <Filter size={18} /> Filter & Sort
          </button>
        </div>
      </div>

      {loading ? (
        <div style={{ textAlign: 'center', padding: '100px' }}>Loading {categoryName}...</div>
      ) : products.length === 0 ? (
        <div style={{ textAlign: 'center', padding: '100px', backgroundColor: 'white', borderRadius: '20px' }}>
          <ShoppingBag size={48} color="#ccc" style={{ marginBottom: '20px' }} />
          <h3>No products found in this category yet.</h3>
        </div>
      ) : (
        <div style={productGrid}>
          {products.map((product) => (
            <div key={product.id} style={productCard}>
              <div style={imgWrapper}>
                <img src={product.image_url} alt={product.name} style={imgStyle} />
              </div>
              <div style={{ padding: '20px' }}>
                <h4 style={titleStyle}>{product.name}</h4>
                <p style={{ fontSize: '13px', color: '#666' }}>Free delivery in Kigali</p>
                <div style={priceRow}>
                  <span style={priceText}>RWF {product.price.toLocaleString()}</span>
                  <button onClick={() => addToCart(product)} style={addBtn}></button>
                    <Plus size={20} />
                  </div>
                </div>
              </div>
            
          ))}
        </div>
      )}
    </div>
  );
};

// --- Styles ---
const filterBtn = { display: 'flex', alignItems: 'center', gap: '8px', padding: '10px 20px', borderRadius: '10px', border: '1px solid #ddd', backgroundColor: 'white', cursor: 'pointer', fontWeight: 'bold' };
const productGrid = { display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))', gap: '25px' };
const productCard = { backgroundColor: 'white', borderRadius: '16px', overflow: 'hidden', border: '1px solid #eee', transition: '0.3s' };
const imgWrapper = { height: '220px', display: 'flex', alignItems: 'center', justifyContent: 'center', backgroundColor: '#f9f9f9' };
const imgStyle = { maxWidth: '75%', maxHeight: '75%', objectFit: 'contain' };
const titleStyle = { fontSize: '17px', fontWeight: '700', margin: '0 0 10px 0', color: '#1a1a1a' };
const priceRow = { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginTop: '15px' };
const priceText = { fontSize: '20px', fontWeight: '800', color: '#008ECC' };
const addBtn = { backgroundColor: '#008ECC', color: 'white', border: 'none', width: '40px', height: '40px', borderRadius: '12px', cursor: 'pointer', display: 'flex', alignItems: 'center', justifyContent: 'center' };

export default CategoryPage;
